import logo200Image from 'assets/img/logo/logo_200.png';
import React from 'react';
import { Button, Form, FormGroup, Input, Label, Row,  Modal,
    ModalBody,
    ModalFooter,
    ModalHeader, } from 'reactstrap';
import { withRouter, Link } from "react-router-dom";

class BlankPage extends React.Component {
  constructor() {
    super()
    this.state = {
      modal: true,
      modal_backdrop: false,
      modal_nested_parent: false,
      modal_nested: false,
      backdrop: true,
    }

  }

  redirect(e) {
    e.preventDefault()
    //localStorage.removeItem('usertoken')
    this.props.history.push(`/iot_test`)
  }
 
  toggle = modalType => () => {
    if (!modalType) {
      return this.setState({
        modal: !this.state.modal,
      });
    }
    this.setState({
      [`modal_${modalType}`]: !this.state[`modal_${modalType}`],
    });
  };
  render() {


    return (
     <Row>
             <Modal
                isOpen={this.state.modal}
                toggle={this.toggle()}
                className={this.props.className}>
                <ModalHeader toggle={this.toggle()}>INFO</ModalHeader>
                <ModalBody>
                  Votre session Commence maintenant . Bon courage !
                  </ModalBody>
                <ModalFooter>
                    <Link>
                  <Button color="primary" >
                    OK
                   
                    </Button>
                    </Link>
                </ModalFooter>
              </Modal>
     </Row>
    );
  }
}



export default withRouter(BlankPage);
